import React, { Component } from 'react';
import TextCard from './TextCard/TextCard';
import Button from '../Button/Button'

class BodyCard extends Component {
    render (){

    const texto = 'Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum.';
    const texto1 = 'Lorem  ipsum dolor sit amr sit amet, consetetur sadipscing elr sit amet, consetetur sadipscing elr sit amet, consetetur sadipscing elr sit amet, consetetur sadipscing elet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum.';

    const gretting = 'Hablemos';
    const estiloButton = 'br4-ns br3 ba color-boton ttu white center pt2 pb2 pr4 pl4 f4 f2-ns no-underline grow';


    return (
        <div className='white' >
            <div className='tc'>
                <p className='fw6 f3 f2-ns lh-title pt2 ma3'>Dudas y Respuestas</p>
                <a href="#acuerdo" class="f5 no-underline bg-animate  hover-pink:pink inline-flex items-center grow">
                <svg width="34" height="20" viewBox="0 0 34 20" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M4.32488 2L17 16.9119L29.6751 2H4.32488Z" fill="black" stroke="black" stroke-width="4"/>
                </svg>
                </a>
            </div>

            <div id='acuerdo' className='pv4 cf flex-ns flex-column justify-center-ns' >
                <div className='fl w-100 w-30-ns ph2'>
                    <TextCard contenido = {texto1} />
                    <TextCard contenido = {texto} />
                    <TextCard contenido = {texto} />
                </div>
                <div className='fl w-100 w-25-ns ph2'>
                    <TextCard contenido = {texto} />
                    <TextCard contenido = {texto1} />
                    <TextCard contenido = {texto} />        
                </div>

            <div className='center flex '>
                <div  className='center mb3 pr4' >
                    <Button text = {gretting}  estilo = {estiloButton} onSumbitSubscription = {this.onSumbitSubscription} />
                </div>
                <div  className='center mb3 pl4' >
                    <Button text = {gretting}  estilo = {estiloButton} onSumbitSubscription = {this.onSumbitSubscription} />
                </div>    
            </div>

            </div>
        </div>
    );

    }
    }

    export default BodyCard;
